import React from 'react'

export default function PageComp(props) {
  return (
    <div className='Pagescreen'>
        <h1>{props.tile}</h1>
      <div className='movies-container'>
      <iframe width="300" height="200" src={props.link1}
         frameborder="20" 
          allowfullscreen
         ></iframe>

        <iframe width="400" height="200" src={props.link2}
         frameborder="20" 
         allowfullscreen
         ></iframe>

        <iframe width="400" height="200" src={props.link3}
         frameborder="20" 
         allowfullscreen
         ></iframe>

        <iframe width="400" height="200" src={props.link4}
         frameborder="20" 
         allowfullscreen
         ></iframe>
      </div>
    </div>
  )
}
